import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom"

import Home from "./pages/Home"
import Login from "./pages/Login"
import Register from "./pages/Register"
import SellerDashboard from "./pages/SellerDashboard"
import CustomerDashboard from "./pages/CustomerDashboard"
import ChatPage from "./pages/ChatPage"
import ChatMutal from "./pages/ChatMutal";
// import SellerPostPage from "./pages/SellerPostPage"; // Commented, not provided

function App() {
  const [profile, setProfile] = useState({
    fullName: "John Doe",
    address: "123 Tailoring Street, City",
    phone: "+91 9876543210",
    tailoringName: "John's Tailors",
    email: "john@example.com",
    photoUrl: "https://via.placeholder.com/80"
  });

  // You may need a modal state here if ProfileModal is global
  const [showProfileModal, setShowProfileModal] = useState(false);
  const [editProfile, setEditProfile] = useState(false);
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/seller" element={<SellerDashboard />} />
        <Route path="/customer" element={<CustomerDashboard />} />
        {/* Optional: Keep simple chat on a separate route */}
        {/* <Route path="/chat-simple" element={<ChatPage />} /> */}
        <Route path="/chat" element={<ChatMutal />} />
        {/* <Route path="/seller-post" element={<SellerPostPage />} /> */}
        <Route path="*" element={<Navigate to="/" />} />
      </Routes>
    </Router>
  );
}
export default App;
